import React from 'react';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';


const match = (props) => {
    return (
        <div className="container-fluid">
            <div className="row" >
                <div className="col-xs-1 col-lg-2" >
                </div>
                <div className="col-xs-10 col-lg-8" style={{ background: 'grey', marginTop: 20 }}>
                    <div style={{ paddingLeft: '10', paddingRight: '10' }}>
                        <h2>India vs west indies </h2>
                        <h6> india 230/5 vs wi 201/5</h6>
                        <h3>india won by 29 runs</h3>
                        <button className="btn btn-primary">match details</button>
                    </div>
                </div>
                <div className="col-xs-1 col-lg-2" >
                </div>
            </div>
        </div>
    );
}

export default match;
